import Header from './Header';
const Home = () => {
  return (
    <div className="container">
    
   <Fragment>
     <Header />
      <section className='number'>
        <div className='contaner'>
          <div className='row'>

          </div>


        </div>
      </section>   
   </Fragment>  
  </div>
  )
}
export default Home;
